import './App.css';
import Splash from './components/Splash';
import About from './components/About';
import MainWorks from './components/MainWorks';
import SideWorks from './components/SideWorks';
import CTA from './components/CTA';


function App() {
  return (
    <div className="App">
      <Splash />
      <About />

      <MainWorks title='Escapee' category='Video Game • RPG • Unity' images={[1, 2, 3]} dark={false} ytLink={<iframe width="560" height="315" src="https://www.youtube.com/embed/f3OJeqz19LE" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>} />
      <MainWorks title='Liminal Floor' category='Study • Horror • React.js' images={[7, 8, 9]} dark={false} ytLink={<iframe width="560" height="315" src="https://www.youtube.com/embed/oDc_kKkF0g0" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>} />
      <MainWorks title='Flower Magic' category='Video Game • Visual Novel • Unity' images={[5, 6]} dark={true} />
      <MainWorks title='Water Monopoly' category='Board Game • Speculative Design • Adobe Illustrator' images={[11, 12, 13]} dark={false} />
      <MainWorks title='Jane Austen' category='Website • VR • Next.js' images={[14, 15, 16]} dark={true} />
      <MainWorks title='SALBOY FIFTY5IVE' category='Website • VR • JQuery' images={[17, 18, 19]} dark={true} />

      <SideWorks title='Marketing' category='AIESEC, Dimsum Culture Platform' images={[11, 12, 13]} />
      <SideWorks title='Graphic' category='VA works, ISSIA' images={[11, 12, 13]} />

      <CTA />
    </div>
  );
}

export default App;
